import './App.css';
import ChatBot from './ChatBot';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div>
      <Router>
        <Header />
        <Switch>
          <Route path='/chatBot' Component={ChatBot} />
          <Route path='/' Component={Home} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
